create table MOCK_DATA (
	id INT,
	companhia_aerea VARCHAR(50),
	origem_aeroporto VARCHAR(50),
	destino_aeroporto VARCHAR(50),
	data_partida DATE,
	dia_da_semana INT,
	atraso_previsto INT,
	probabilidade_atraso DECIMAL(3,2),
	modelo_versao DECIMAL(1,1),
	tempo_resposta_ms DECIMAL(5,2),
	status DECIMAL(3,2),
	request_at DATE
);
